                    <div className='col-6 mt-5'>Week:</div>
                </div>

                <div className='row'>
                    <div className='col-6 mt-5'>Average calorie intake(needed):</div>
                    <div className='col-6 mt-5'>Diffculty:</div>
                </div>

            </div>
        </div>

    )
}

export default Status
